          var b = cb_obj.get(\"active\");\n            var rgbToHex = function(rgb){\n              var hex = Number(rgb).toString(16);\n              if (hex.length < 2) {\n                   hex = \"0\" + hex;\n              }\n              return hex;\n            };\n            var fullColorHex = function(r,g,b) {\n                var red = rgbToHex(r);\n                var green = rgbToHex(g);\n                var blue = rgbToHex(b);\n                return \"#\"+red+green+blue;\n            };\n            // models passed as args are automagically available\n            var data = source.data;\n            var len = data.color.length;\n            var col = [];\n            var othercol = '#1abc9c';\n            \n            if(b === 0){ //show clusters\n                var j = 0;\n                if(data.clusters){\n                    for(i=0;i<len;++i){col.push(colors[1+data.clusters[i]]);}\n                }else{\n                    for(i=0;i<len;++i){col.push(othercol);}\n                }\n                source.data.color = col;\n            }\n            if(b === 1){//show num_genes\n                var temp = 0\n                max = Math.max(...data.num_genes)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(92 * data.num_genes[i]/max);\n                    col.push(fullColorHex(temp, 152, 219));\n                    }\n                source.data.color = col;\n            }\n            if(b === 2) { //show genome_size\n                var temp = 0\n                max = Math.max(...data.genome_size)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(252 * data.genome_size[i]/max);\n                    col.push(fullColorHex(temp, 152, 219));\n                    }\n                source.data.color = col;\n            }\n            if(b === 3) {  //show show full/mean CUB diff\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(200 * data.efulldiff[i]);\n                    col.push(fullColorHex(temp, 204, 113));\n                    }\n                source.data.color = col;\n            }\n            if(b === 4){ //Show GC count\n                var temp = 0\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * data.gccount[i]);\n                    col.push(fullColorHex(temp, temp, 113));\n                }\n                data.color = col;\n            }\n            if(b === 5){ //show fullmean GC diff\n                var temp = 0\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * data.gcfulldiff[i]);\n                    col.push(fullColorHex(temp, 204, temp));\n                }\n                data.color = col;\n            }\n            if(b === 6){ //show GC variance\n                var temp = 0\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(455 * data.varGCcount[i]);\n                    col.push(fullColorHex(temp, temp, 113));\n                }\n                data.color = col;\n            }\n            if(b === 7){ //show distance to tRNA UB\"\n                source.data.color = source.data.recent;\n            }\n            if(b === 8){ //  show tRNA number\n                var temp = 0\n                max = Math.max(...data.tRNA_number)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(14 + (240 * data.tRNA_number[i]/max));\n                    col.push(fullColorHex(152, 23, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b === 9){ //  show avgphilodistance\n                var temp = 0\n                max = Math.max(...data.distances);\n                min = Math.min(...data.distances);\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(254 * (data.distances[i]-min)/(max-min));\n                    col.push(fullColorHex(52, 73, temp));\n                    }\n                source.data.color = col;\n            }\n            /*\n            if(b === 10){ //  show full phylodistance\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(64 + 100 * data.gc[i]));\n                    col.push(fullColorHex(52, 73, temp));\n                    }\n                source.data.color = col;\n            }*/\n            if(b > 10){ \n                for(i=0;i<len;++i){\n                    if(data[String(b)][i]){\n                        col.push(colors[2])\n                    }else{\n                        col.push(colors[3])\n                    }\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"a67dcadd-e851-4b32-867f-d0c5d45abab3","type":"CustomJS"},{"attributes":{"data_source":{"id":"1222c85b-a4a0-40c4-9ad5-efd1837dc875","type":"ColumnDataSource"},"glyph":{"id":"59a166f4-83e6-4afd-b269-bf71058e9efa","type":"Circle"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"f3173153-8571-46ec-8cb6-41fc407e4175","type":"Circle"},"selection_glyph":null,"view":{"id":"7f6aeaa2-14f3-42a3-b122-cbfbef4034b1","type":"CDSView"}},"id":"4aa279d5-e410-4ce0-bf98-e1aa8a265746","type":"GlyphRenderer"},{"attributes":{"formatter":{"id":"f755eb88-9dfc-45c2-961c-a828d77c7133","type":"BasicTickFormatter"},"plot":{"id":"71e33db1-0f5d-43cd-9be5-1b3a076b0b3f","subtype":"Figure","type":"Plot"},"ticker":{"id":"6813d352-7dab-4789-8cca-652d8d012e18","type":"BasicTicker"}},"id":"74b71748-5a20-4cec-a2f0-9a2a8ae098db","type":"LinearAxis"},{"attributes":{"active":7,"callback":{"id":"a67dcadd-e851-4b32-867f-d0c5d45abab3","type":"CustomJS"},"labels":["show clusters","show num_genes","show genome_size","show full/mean CUB diff","show GCcount","show full/mean GC diff","show GC variance","show distance to tRNA UB","show tRNA number","show avg phylodistance","show full phylo distance","show if isplant_symbiotic","show i
